<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="utf-8">
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <meta http-equiv="X-UA-Compatible" content="ie=edge">
    <title>Header</title>
</head>
<body>
    <div class="header">
        <div class="header-logo">
            <div>
                <svg width="20" height="20" viewBox="0 0 20 20" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
                    <rect width="20" height="20" fill="url(#pattern0)"/>
                    <defs>
                        <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
                            <use xlink:href="#image0" transform="scale(0.0030303)"/>
                        </pattern>
                        <image id="image0" width="330" height="330" xlink:href="data:image/png;base64,"/>
                    </defs>
                </svg>
            </div>
            <div class="ml-20">
                <p>
                    Industry Report:
                    <span>
                    Technical analysis and market data
                    </span>
                </p>
            </div>
        </div>
        <div class="header-info">
            <div class="mr-88">
                <p>
                    Created by Locate Cambridge for:
                    <span>
                    Nick from Aventis Group
                    </span>
                </p>
            </div>
            <div class="mr-33">
                <p>
                    Enquiries:
                    <span>
                    rosa.delcampo@growthworks.uk
                    </span>
                </p>
            </div>
        </div>
    </div>

<style>
    .header {
        display: flex;
        display: -webkit-box; /* wkhtmltopdf uses this one */
        -webkit-box-pack: justify; /* wkhtmltopdf uses this one */
        justify-content: space-between;
        -webkit-box-align: center;      /* WebKit */
        align-items: center;
        font-family: Meta Pro;
        padding: 20px 40px;
    }

    .header-logo {
        display: flex;
        display: -webkit-box; /* wkhtmltopdf uses this one */
        -webkit-box-pack: justify; /* wkhtmltopdf uses this one */
        justify-content: space-between;
        -webkit-box-align: center;      /* WebKit */
        align-items: center;
    }

    .header-info {
        display: flex;
        display: -webkit-box; /* wkhtmltopdf uses this one */
        -webkit-box-pack: justify; /* wkhtmltopdf uses this one */
        justify-content: space-between;
        -webkit-box-align: center;      /* WebKit */
        align-items: center;
        padding-right: 33px;
    }

    .header span {
        display: block;
        font-weight: bold;
    }

    .header p {
        font-size: 17px;
        line-height: 17px;
        font-weight: lighter;
    }

    .ml-20 {
        margin-left: 20px;
    }

    .mr-88 {
        margin-right: 55px;
    }

    .mr-33 {
        margin-right: 33px;
    }

    @font-face {
        font-family: "Meta Pro";
        /* Add other properties here, as needed. For example: */
        /*
        font-weight: 100 900;
        font-style: normal italic;
        */
        src: url("data:application/font-woff;base64,");
    }


</style>
</body>
</html>
